import s from "./Map.module.css";

export default function Map() {
  return (
    <div className={s.map_div}>
      <iframe
        title="Google Map"
        frameBorder="0"
        scrolling="no"
        marginHeight="0"
        marginWidth="0"
        src="https://www.google.com/maps/place/Bahnhofstra%C3%9Fe+41,+08297+Zw%C3%B6nitz/@50.6310764,12.8009143,17z/data=!3m1!4b1!4m10!1m2!2m1!1sBahnhofstra%C3%9Fe+41!3m6!1s0x47a0b4d7854e0643:0xc016f7bb62a3b2d8!8m2!3d50.6310731!4d12.8057852!15sChFCYWhuaG9mc3RyYcOfZSA0MZIBEWNvbXBvdW5kX2J1aWxkaW5n4AEA!16s%2Fg%2F11cncdvl9r?entry=ttu"
        loading="lazy"
      >
        <a href="https://www.maps.ie/population/">Population Estimator map</a>
      </iframe>
    </div>
  );
}
